namespace RonSijm.FluidHumidifier.Factories.Route53;

public class RecordSetFactory(string resourceName = null, Action<Humidifier.Route53.RecordSet> factoryAction = null) : ResourceFactory<Humidifier.Route53.RecordSet>(resourceName)
{

    internal InnerRecordSetAliasTargetFactory AliasTargetFactory { get; set; }

    internal InnerRecordSetCidrRoutingConfigFactory CidrRoutingConfigFactory { get; set; }

    internal InnerRecordSetGeoLocationFactory GeoLocationFactory { get; set; }

    internal InnerRecordSetGeoProximityLocationFactory GeoProximityLocationFactory { get; set; }

    protected override Humidifier.Route53.RecordSet Create()
    {
        var recordSetResult = CreateRecordSet();
        factoryAction?.Invoke(recordSetResult);

        return recordSetResult;
    }

    private Humidifier.Route53.RecordSet CreateRecordSet()
    {
        var recordSetResult = new Humidifier.Route53.RecordSet
        {
            GivenName = InputResourceName,
        };

        return recordSetResult;
    }
    public override void CreateChildren(Humidifier.Route53.RecordSet result)
    {
        base.CreateChildren(result);

        result.AliasTarget ??= AliasTargetFactory?.Build();
        result.CidrRoutingConfig ??= CidrRoutingConfigFactory?.Build();
        result.GeoLocation ??= GeoLocationFactory?.Build();
        result.GeoProximityLocation ??= GeoProximityLocationFactory?.Build();
    }

} // End Of Class

